import React from 'react'
import { AiOutlineWarning } from 'react-icons/ai'

export default function ErrorMsg(msg) {
    return (
        <span className = 'border p-2 d-flex' style = {{width: ''}}>
            <AiOutlineWarning className = 'align-self-center'/>
           <span> {msg}</span>
        </span>
    )
}
